INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(1, 'Paracetamol', 'Fever', 'Paracetamol is used to treat fever. It reduces pain as well. It can be taken with Ibuprofen as both these medications work differently in the body. Overdose of paracetamol is potentially very harmful, and anyone who thinks they may have taken too much paracetamol should seek urgent medical attention. ', 3.8, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(2, 'Ibuprofen', 'Fever', 'Ibuprofen is used in a very similar way to paracetamol. It treats pain but can also be used to treat fever. The main difference is that ibuprofen reduces inflammation.', 6.5, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(3, 'Aspirin', 'Fever', 'Aspirin is used to reduce fever and relieve mild to moderate pain from conditions such as muscle aches, toothaches, common cold, and headaches.', 4.9, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(4, 'Loperamide', 'Diarrhoea', 'This medication is used to treat sudden diarrhoea. Loperamide treats only the symptoms, not the cause of the diarrhea. Before taking loperamide, tell your doctor or pharmacist if you are allergic to it; or if you have any other allergies. This product may contain inactive ingredients, which can cause allergic reactions or other problems.  ', 4, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(5, 'Oral Rehydration Salt', 'Diarrhoea', 'Oral rehydration therapy (ORT) is a type of fluid replacement used to prevent and treat dehydration, especially that due to diarrhea.It involves drinking water with modest amounts of sugar and salts, specifically sodium and potassium. Side effects may include vomiting, high blood sodium, or high blood potassium. If vomiting occurs, it is recommended that use be paused for 10 minutes and then gradually restarted.', 1, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(6, 'Atropine', 'Diarrhoea', 'This medication is used to treat occasional upset stomach, heartburn, and nausea. It is also used to treat diarrhoea and help prevent travelers\' diarrhoea. It works by helping to slow the growth of bacteria that might be causing the diarrhoea. This product should not be used to self-treat diarrhoea if you also have a fever or blood/mucus in the stools. These could be signs of a serious health condition. Consult your doctor promptly for proper evaluation and treatment if you have these symptoms.', 1.5, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(7, 'Loratadine', 'Flu', 'Loratadine is an antihistamine that reduces the effects of natural chemical histamine in the body. Histamine can produce symptoms of sneezing, itching, watery eyes, and runny nose.\r\nLoratadine is used to treat sneezing, runny nose, watery eyes, hives, skin rash, itching, and other cold or allergy symptoms. Loratadine often has side effects such as dry mouth and ,mild dizziness.', 39.4, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(8, 'FluCough Syrup', 'Flu', 'Traditionally used to relieve cold, soothe cough and reduce phlegm, relieve fever, reduce body heatiness and relieve sore throat.', 16.9, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(9, 'FluAway', 'Flu', 'Traditionally used for relief of flu, common cold, running nose and nasal congestion.', 6.6, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(10, 'Milk of Magnesia', 'Gastritis', 'This medication is used to treat symptoms caused by too much stomach acid such as heartburn, upset stomach, or indigestion. It is an antacid that works by lowering the amount of acid in the stomach.', 8.3, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(11, 'Prevacid', 'Gastritis', 'This medication blocks acid production and promotes healing. Proton pump inhibitors reduce acid by blocking the action of the parts of cells that produce acid.', 23, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(12, 'Ranitidin', 'Gastritis', 'Reduces the amount of acid released into the digestive tract, which relieves gastritis pain and encourages healing.', 7.2, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(13, 'Trimethoprim', 'UTI', 'Trimethoprim is an antibiotic. It\'s used to treat urinary tract infections (UTIs). Side effects may include itching or a mild skin rash, but these are usually mild and short-lived. The dose of trimethoprim you need to take depends on your illness, your age, and how well your kidneys work.', 17.5, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(14, 'Fosfomycin', 'UTI', 'Fosfomycin is an antibiotic that fights infection caused by bacteria. Fosfomycin is used to treat bladder infections. To be sure fosfomycin is the right antibiotic for the type of infection you have, your urine may need to be tested before and after you take this medicine.', 19.2, );
INSERT INTO `medicine` (`id`, `name`, `category`, `description`, `estimated_price`, `image`) VALUES
(15, 'Cephalexin', 'UTI', 'Cephalexin is a cephalosporin (SEF a low spor in) antibiotic. It works by fighting bacteria in your body.\r\nCephalexin is used to treat infections caused by bacteria, including upper respiratory infections, ear infections, skin infections, urinary tract infections and bone infections.', 14, ),
